import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer></footer>
           <nav className="navbar text-bg-dark shadow">
                <div className="container-fluid">
                    <p className="text-end">Navbar</p>
                </div>
            </nav>
        </div>
    );
}

export default Footer;
